oth a location-based feature, as well as a &quot;Track&quot; feature which enables users to view popular items based on both their current location in addition to what their friends are posting. Trendy users can view 100+ locations all over the globe and see what people in every corner of the world are wearing, as well as purchase any item they see.</span></p>\n<br />\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\n	<span style=\"font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Trendy is broken up into 4 sections (feeds): Recent, Trends, and Social as well as a variety of &ldquo;Occasions&rdquo; where clothing can be recommended by other users for specific events or occasions. </span></p>\n<ul style=\"margin-top:0pt;margin-bottom:0pt;\">\n	<li dir=\"ltr\" style=\"list-style-type:disc;font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">\n		<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\n			<span style=\"font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">The Recent feed is a collection of the most recently posted items for any given location and users can vote on whether or not they like an item by using the + and - buttons directly on each item. </span></p>\n	</li>\n	<li dir=\"ltr\" style=\"list-style-type:disc;font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">\n		<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\n			<span style=\"font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">The Trends feed is a collection of all the items that have obtained at least 20 net votes in a given area. Users can vote directly on the details page for these items. </span></p>\n	</li>\n	<li dir=\"ltr\" style=\"list-style-type:disc;font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">\n		<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\n			<span style=\"font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">The Social feed is a collection of all the products that have been posted by those that any given user &ldquo;Tracks&rdquo;. These items can only be voted on if the item was posted in the same area as the user that is viewing the post. </span></p>\n	</li>\n	<li dir=\"ltr\" style=\"list-style-type:disc;font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">\n		<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\n			<span style=\"font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">The Occasions are 5-10 specially chosen clothing themes based on current events or a certain time of year. Users can add items to these occasions while posting an item or by clicking the add to occasion button on the details page of any given item. If other users do not agree with an item being placed in a given occasion, they can vote to have it removed. </span></p>\n	</li>\n</ul>\n<br />\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\n	<span style=\"font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Users can post items directly from any retail website using the web browser within the application. </span></p>\n<br />\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\n	<span style=\"font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Each user has a unique profile where they can:</span></p>\n<ul style=\"margin-top:0pt;margin-bottom:0pt;\">\n	<li dir=\"ltr\" style=\"list-style-type:disc;font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">\n		<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\n			<span style=\"font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">View all their Saved, Posted, and Reviewed items</span></p>\n	</li>\n	<li dir=\"ltr\" style=\"list-style-type:disc;font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">\n		<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\n			<span style=\"font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Track new users </span></p>\n	</li>\n	<li dir=\"ltr\" style=\"list-style-type:disc;font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">\n		<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\n			<span style=\"font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">See who is currently Tracking them</span></p>\n	</li>\n	<li dir=\"ltr\" style=\"list-style-type:disc;font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">\n		<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\n			<span style=\"font-size:14.666666666666666px;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Change the settings within the application</span></p>\n	</li>\n</ul>\n','N',NULL);
