  `username` varchar(200) DEFAULT NULL,
  `device_id` varchar(200) DEFAULT NULL,
  `location` varchar(200) DEFAULT NULL,
  `email_verified` enum('N','Y') DEFAULT 'Y',
  `gender` enum('Male','Female') DEFAULT 'Male',
  `bot` enum('NO','YES') DEFAULT 'NO',
  `bot_lat` varchar(100) NOT NULL,
  `bot_long` varchar(100) DEFAULT NULL,
  `activation_code` varchar(25) NOT NULL,
  `active_flag` enum('N','Y') DEFAULT 'N',
  `userType` varchar(110) DEFAULT 'fbaccount',
  PRIMARY KEY (`user_id`),
  KEY `user_type` (`user_type`)
